// SPDX-License-Identifier: CPL-3.0
//MIT...
pragma solidity >=0.4.16 <0.9.0;
import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "./KerwinToken.sol";

contract Exchange {
    using SafeMath for uint256;

    // 
    address public feeAccount;
    uint256 public feePercent; //1/100000.01%
    address constant ETHER = address(0);

    // --
    //
    //-A10B20C30
    //-A10B20C30
    //KWT-A10B20C30
    mapping(address => mapping(address => uint256)) public tokens;

    mapping(uint256 => bool) public orderCannel; // 0- 1-
    mapping(uint256 => bool) public orderFill;

    //
    struct _Order {
        uint256 id;
        address user;
        address tokenGet;
        uint256 amountGet;
        address tokenGive;
        uint256 amountGive;
        uint256 timestamp;
    }

    // _Order[] orderList;

    mapping(uint256 => _Order) public orders;
    uint256 public orderCount;

    constructor(address _feeAccount, uint256 _feePercent) {
        feeAccount = _feeAccount;
        feePercent = _feePercent;
    }

    event Deposit(address token, address user, uint256 amount, uint256 balance);
    event WithDraw(
        address token,
        address user,
        uint256 amount,
        uint256 balance
    );
    //
    event Order(
        uint256 id,
        address user,
        address tokenGet,
        uint256 amountGet,
        address tokenGive,
        uint256 amountGive,
        uint256 timestamp
    );

    //
    event Cancel(
        uint256 id,
        address user,
        address tokenGet,
        uint256 amountGet,
        address tokenGive,
        uint256 amountGive,
        uint256 timestamp
    );

    //
    event Trade(
        uint256 id,
        address user,
        address tokenGet,
        uint256 amountGet,
        address tokenGive,
        uint256 amountGive,
        uint256 timestamp
    );

    //
    function depositEther() public payable {
        //msg.sender
        //msg.value
        tokens[ETHER][msg.sender] = tokens[ETHER][msg.sender].add(msg.value);
        emit Deposit(ETHER, msg.sender, msg.value, tokens[ETHER][msg.sender]);
    }

    //
    function depositToken(address _token, uint256 _amount) public {
        require(_token != ETHER);
        //
        require(
            // msg.sender  _token  _amount  address(this)
            KerwinToken(_token).transferFrom(msg.sender, address(this), _amount)
        );
        tokens[_token][msg.sender] = tokens[_token][msg.sender].add(_amount);
        emit Deposit(_token, msg.sender, _amount, tokens[_token][msg.sender]);
    }

    //
    function withdrawEther(uint256 _amount) public {
        require(tokens[ETHER][msg.sender] >= _amount, "Not enough balance");
        tokens[ETHER][msg.sender] = tokens[ETHER][msg.sender].sub(_amount);
        //msg.sender
        payable(msg.sender).transfer(_amount);
        emit WithDraw(ETHER, msg.sender, _amount, tokens[ETHER][msg.sender]);
    }

    //KWT
    function withdrawToken(address _token, uint256 _amount) public {
        require(_token != ETHER);
        require(tokens[_token][msg.sender] >= _amount, "Not enough balance");

        tokens[_token][msg.sender] = tokens[_token][msg.sender].sub(_amount);

        //transfer(to, value)
        require(KerwinToken(_token).transfer(msg.sender, _amount));

        emit WithDraw(_token, msg.sender, _amount, tokens[_token][msg.sender]);
    }

    //
    function balanceOf(
        address _token,
        address _user
    ) public view returns (uint256) {
        return tokens[_token][_user];
    }

    //
    function makeOrder(
        address _tokenGet,
        uint256 _amountGet,
        address _tokenGive,
        uint256 _amountGive
    ) public {
        require(
            balanceOf(_tokenGive, msg.sender) >= _amountGive,
            "Not enough balance"
        );

        orderCount = orderCount.add(1);

        orders[orderCount] = _Order(
            orderCount,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            block.timestamp
        );

        //
        emit Order(
            orderCount,
            msg.sender,
            _tokenGet,
            _amountGet,
            _tokenGive,
            _amountGive,
            block.timestamp
        );
    }

    //
    function cancelOrder(uint256 _id) public {
        _Order memory myorder = orders[_id];
        require(myorder.id == _id);
        //id->bool 
        //mapping(uint256 => bool) public orderCannel; // 0- 1-
        orderCannel[_id] = true;

        emit Cancel(
            myorder.id,
            msg.sender,
            myorder.tokenGet,
            myorder.amountGet,
            myorder.tokenGive,
            myorder.amountGive,
            block.timestamp
        );
    }
    //
    function fillOrder(uint256 _id) public {
        _Order memory myorder = orders[_id];
        require(myorder.id != 0, "order not exist");
        require(myorder.id == _id, "order ID does not match");
        require(!orderFill[_id], "order already filled");

        //  
        uint256 feeAmount = myorder.amountGet.mul(feePercent).div(100);

        //
        require(
            balanceOf(myorder.tokenGive, myorder.user) >= myorder.amountGive,
            "create order Not enough balance"
        );

        //KWT
        require(
            balanceOf(myorder.tokenGet, msg.sender) >=
                myorder.amountGet.add(feeAmount),
            "pay order Not enough KWT balance"
        );

        require(feeAccount != address(0), "feeAccount not set");
        //
        tokens[myorder.tokenGet][feeAccount] = tokens[myorder.tokenGet][
            feeAccount
        ].add(feeAmount);

        // KWT + 
        tokens[myorder.tokenGet][msg.sender] = tokens[myorder.tokenGet][
            msg.sender
        ].sub(myorder.amountGet.add(feeAmount));

        // ETH
        tokens[myorder.tokenGive][msg.sender] = tokens[myorder.tokenGive][
            msg.sender
        ].add(myorder.amountGive);

        // KWT
        tokens[myorder.tokenGet][myorder.user] = tokens[myorder.tokenGet][
            myorder.user
        ].add(myorder.amountGet);

        // ETH
        tokens[myorder.tokenGive][myorder.user] = tokens[myorder.tokenGive][
            myorder.user
        ].sub(myorder.amountGive);

        //
        orderFill[_id] = true;

        emit Trade(
            myorder.id,
            //msg.sender,myorder.user
            myorder.user,
            myorder.tokenGet,
            myorder.amountGet,
            myorder.tokenGive,
            myorder.amountGive,
            block.timestamp
        );
    }
}
